import React from 'react'
import ReactDOM from 'react-dom'
import Card from './Card'
import Sdata from './Sdata'

// console.log(Sdata[0].title)

function ncard(val) {
  return (
    <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link}
    />
  )
}

ReactDOM.render(
  <>
    <h1>List of Top 5 Netflix Series</h1>
    {Sdata.map(ncard)}
  </>,
  document.getElementById('root')
)
